CREATE DATABASE jasu_database;

USE jasu_database;

-- Table: signup
CREATE TABLE `signup` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `student_id` varchar(20) DEFAULT NULL,
  `surname` varchar(30) DEFAULT NULL,
  `middlename` varchar(30) DEFAULT NULL,
  `lastname` varchar(30) DEFAULT NULL,
  `gender` varchar(2) DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `phone` varchar(15) DEFAULT NULL,
  `email` varchar(70) DEFAULT NULL,
  `region` varchar(20) DEFAULT 'Upper West',
  `municipal` varchar(20) DEFAULT 'Jirapa',
  `hometown` varchar(30) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `data_of_signup` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `passport` mediumblob DEFAULT NULL,
  `usertype` varchar(15) DEFAULT 'student',
  PRIMARY KEY (`id`)
);

-- Table: applicant_info
CREATE TABLE `applicant_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `student_id` varchar(20) DEFAULT NULL,
  `firstname` varchar(50) DEFAULT NULL,
  `middlename` varchar(50) DEFAULT NULL,
  `lastname` varchar(50) DEFAULT NULL,
  `dob` date DEFAULT NULL,
  `gender` varchar(6) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `phone` varchar(15) DEFAULT NULL,
  `maritalstatus` varchar(10) NOT NULL,
  `NoOfChildren` int(11) DEFAULT NULL,
  `disability` char(3) DEFAULT 'NO',
  `describe_disability` varchar(80) DEFAULT NULL,
  `residentialAddress` varchar(100) DEFAULT NULL,
  `hometown` varchar(50) DEFAULT NULL,
  `district` varchar(50) DEFAULT NULL,
  `region` varchar(25) DEFAULT NULL,
  `WDYNTS` varchar(500) DEFAULT NULL,
  `WDYTWSGYTS` varchar(500) DEFAULT NULL,
  `f_fullname` varchar(50) DEFAULT NULL,
  `f_nationality` varchar(12) DEFAULT NULL,
  `f_district` varchar(30) DEFAULT NULL,
  `f_hometown` varchar(30) DEFAULT NULL,
  `f_phone` char(10) DEFAULT NULL,
  `f_email` varchar(60) DEFAULT NULL,
  `f_address` varchar(60) DEFAULT NULL,
  `f_livedeceased` varchar(10) DEFAULT NULL,
  `f_occupation` varchar(50) DEFAULT NULL,
  `m_fullname` varchar(50) DEFAULT NULL,
  `m_nationality` varchar(12) DEFAULT NULL,
  `m_district` varchar(30) DEFAULT NULL,
  `m_hometown` varchar(30) DEFAULT NULL,
  `m_phone` char(10) DEFAULT NULL,
  `m_email` varchar(60) DEFAULT NULL,
  `m_address` varchar(60) DEFAULT NULL,
  `m_livedeceased` varchar(10) DEFAULT NULL,
  `m_occupation` varchar(50) DEFAULT NULL,
  `g_fullname` varchar(50) DEFAULT NULL,
  `g_email` varchar(60) DEFAULT NULL,
  `g_phone` char(10) DEFAULT NULL,
  `g_address` varchar(50) DEFAULT NULL,
  `g_region` varchar(50) DEFAULT NULL,
  `g_district` varchar(50) DEFAULT NULL,
  `relationToGuardian` varchar(20) DEFAULT NULL,
  `g_employmentstatus` varchar(20) DEFAULT NULL,
  `department` varchar(50) DEFAULT NULL,
  `program` varchar(50) DEFAULT NULL,
  `year_of_admission` varchar(15) DEFAULT NULL,
  `year_of_completion` varchar(15) DEFAULT NULL,
  `level` varchar(15) DEFAULT NULL,
  `duration` varchar(15) DEFAULT NULL,
  `wassce` blob DEFAULT NULL,
  `transcript` blob DEFAULT NULL,
  `resultslip` blob DEFAULT NULL,
  `studentIdcard` blob DEFAULT NULL,
  `duesreciept` blob DEFAULT NULL,
  `dateOfSubmission` timestamp NOT NULL DEFAULT current_timestamp(),
  `processing_stage` varchar(50) DEFAULT 'Short Listing',
  PRIMARY KEY (`id`)
);

